import React, {Component} from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Chip from '@material-ui/core/Chip';

const styles = theme => ({
    config: {},
    key: {
	display: 'inline-block',
        marginRight: 'auto',
    },
    othchip: {
        margin: theme.spacing.unit,
	cursor: "pointer",
        color:"blue",
        borderColor:"blue",
    },
    trashchip: {
        margin: theme.spacing.unit,
	cursor: "pointer",
        color:"gray",
        borderColor:"gray",
  },
});
class TableKey extends Component {
    render() {
        const { classes, state, keyitem, target, onclose } = this.props;
	var tpos=state.Path.trash.indexOf(keyitem);
	var onclick=() => {state.Navigate.onClickTablePath(state,keyitem,target);onclose();};
	//console.log("TableKey:",tpos,keyitem,JSON.stringify(state.Path.keys.other));
	var chip=(tpos!==-1 ? classes.trashchip : classes.othchip);
	var icon=null; //(tpos!==-1 ? <CloseIcon/> : null);
	return (
		<div className={classes.key}>
	 	   <Chip
	              icon={icon}
	              label={keyitem}
	              onClick={onclick}
	              className={chip}
	              variant="outlined"
		   />
		</div>
	);
    }
}

TableKey.propTypes = {
    classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(TableKey);
